import { render } from '@testing-library/react';
import React, { useState } from 'react';
import './App.css';

let currentTitle = `The Movie List`;
let popular = false;

const title = <h1 className="App-title">{currentTitle}</h1>;

const categories = <ol className="Categorie-list"><li><form onSubmit={ActivatePopular()}><button>Popular</button></form></li><li>New Movies</li><li>Movies</li></ol>

class App extends React.Component{
  render() {
    this.state = {title: <h1 className="App-title">{currentTitle}</h1>}
    this.state = {popular: false}

    if (popular)
    {
      return (
        <div className="App">
          <header className="App-header">
            {title}
            <a
              className="App-link"
              href="https://themoviedb.org"
              target="_blank"
              rel="noopener noreferrer"
            >
              List API
            </a>

          </header>
          <body className="App-body">

            <div className="Movie-list">

            </div>

          </body>
        </div>
      );
    }
    else
    {
      return (
        <div className="App">
          <header className="App-header">
            {title}
            <a
              className="App-link"
              href="https://themoviedb.org"
              target="_blank"
              rel="noopener noreferrer"
            >
              List API
            </a>

            {categories}

          </header>
          <body className="App-body">

            <div className="Movie-list">

            </div>

          </body>
        </div>
      );
    }


  }
}

function ActivatePopular(){
  popular = true;
  this.state = {popular: false}
}


export default App;
